import React from "react";
//import Pion from './Pions';
import './style.css';

const Case = () => {

    const Pion = () => {

        const changeColor = (e) => {
            console.log(e.target)
            e.target.classList.add('styled')
        }

        return (
            <div className="pion"></div>
        )
    }

    const change = (e) => {
        if (e.target.classList.contains('styled')) {
            return (
                <div className="pion styled"></div>
            )
        }
    }

    return (
        <div className="rondCases" onClick={change}>
            <Pion />
        </div>
    )
}

export default Case;
